import React from 'react';
import Introduction from './Introduction';
import Footer from './Footer';
import './Footer.css';

function App() {
  return (
    <div className="footer-wrapper">
      <div className="footer-content">
        <Introduction />
      </div>
      <Footer />
    </div>
  );
}

export default App;
